import React from "react";

import Header from "../Components/Header";
import SubPortfolioInfo from "../UI/SubPortfolioInfo";
import Footer from "../Components/Footer";
import SiteButton from "../UI/SiteButton";

import "../fonts/fonts.css";
import classes from "./Petove.module.css";
import classes2 from "./Nespresso.module.css";

const Petove = () => {
  return (
    <div
      style={{
        width: "100%",
        maxWidth: "1920px",
        margin: "0 auto",
        position: "relative",
      }}
    >
      <Header bgColor=" " titleColor="#666666" />

      <div className={classes.info}>
        <img src="images/petove_info.png" alt="" />
      </div>

      <iframe
        className={classes.frame}
        src="images/petove.pdf"
        // width="1200"
        height="800"
        // style={{ boder: "none" }}
        frameborder="0"
      ></iframe>

      <SiteButton
        width="452px"
        top="1300px"
        left="50%"
        transX="-50%"
        btnColor="#f20097"
        textColor="#fff"
        link="https://www.youtube.com/watch?v=Y1qaEd5THSA"
      />

      <Footer footerTop="1400px" />
    </div>
  );
};

export default Petove;
